import React from 'react';

function DoneColumn({ tasks, addTask, removeTask }) {
    return (
      <div className="column done">
        <h2>Done</h2>
        <ul>
          {tasks.map(task => (
            <li key={task.id}>
              {task.text}
              <button onClick={() => removeTask(task.id, 'todo')}>删除</button>
            </li>
          ))}
        </ul>
      </div>
    );
  }


export default DoneColumn;
